    import math
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a
    def lcm(a, b):
        return a * b // gcd(a, b)
    ans = lst[0]
    for i in lst[1:]:
        ans = lcm(ans, i)
    ans = 1
    for i in range(2, int(math.sqrt(ans)) + 1):
        if ans % i == 0:
            while ans % i == 0:
                ans = ans // i
    return ans if ans > 1 else 1

